#include <string>
#include <iostream>

using namespace std;

class Solution {
public:
	char findTheDifference(string s, string t) {
		int diff = 0;
		for (int i = 0; i < s.size(); i++) {
			diff = diff + int(t.at(i)) - int(s.at(i));
		}
		diff += int(t.at(t.size() - 1));
		return char(diff);
	}
};

int main() {
	string x = "";
	string y = "";
	Solution solution;
	cout << solution.findTheDifference(x, y);
}


